#include "../general_include.h"

using namespace std;
class Solution {
public:
    bool checkReq(int* data_s_sub, int* data_t){
        // check if satisfy
        for(int i = 0; i < 52; i++){
            if(data_s_sub[i] < data_t[i]){
                return false;
            }
        }
        return true;
    }

    void addToWin(string& data_str, int& r, int* data_s_sub){
        int cur_idx = data_str[r] - 'A';
        if(cur_idx > 25){
            cur_idx = cur_idx - 6;
        }
        data_s_sub[cur_idx]++;
        r++;
    }

    void removeFromWin(string& data_str, int& l, int* data_s_sub){
        int cur_idx = data_str[l] - 'A';
        if(cur_idx > 25){
            cur_idx = cur_idx - 6;
        }
        data_s_sub[cur_idx]--;
        l++;
    }


    string minWindow(string s, string t) {
        if(s.size() == 0){
            return string("");
        }

        int data_t[52];
        int data_s_sub[52];

        int l = 0;
        int r = 0;

        for(int i = 0; i < 52; i++){
            data_t[i] = 0;
            data_s_sub[i] = 0;
        }

        // count t
        for(int i = 0; i < t.size();i++){
            int cur_idx = t[i] - 'A';
            if(cur_idx > 25){
                cur_idx = cur_idx - 6;
            }
            data_t[cur_idx]++;
        }
        
        int min_len = INT_MAX;
        pair<int,int> min_pair;

        bool global_hit = false;

        addToWin(s,r,data_s_sub);

        while(l < s.size() && r <= s.size()){
            bool hit=false;   // hit flag

            // expanding right perimeter
            while(!checkReq(data_s_sub, data_t) && r < s.size()){
                addToWin(s,r,data_s_sub);
            }
            
            if(checkReq(data_s_sub, data_t)){
                hit=true;
                global_hit = true;
            }

            //shrinking left perimeter
            if(hit == true){
                removeFromWin(s,l,data_s_sub);
                while(l<=r && checkReq(data_s_sub, data_t)){
                    removeFromWin(s,l,data_s_sub);
                }
                if(r-l+1 < min_len){
                    min_len = r-l+1;
                    min_pair.first = l-1;
                    min_pair.second = r-1;
                }
                addToWin(s,r,data_s_sub);
            }else{
                break;
            }

        }

        if(global_hit == true)
        {
            string res =  s.substr(min_pair.first, min_pair.second-min_pair.first+1);
            return res;
        }
        else
        {
            return string("");
        }
    }
};



int main() {
    auto start = std::chrono::high_resolution_clock::now();
    
    Solution a;
    std::string s("");
    std::string t("");
    cout << a.minWindow(s, t) <<endl;

    // End the timer
    auto end = std::chrono::high_resolution_clock::now();

    // Calculate the duration
    std::chrono::duration<double> duration = end - start;

    // Print the runtime in seconds
    std::cout << "Runtime: " << duration.count() << " seconds" << std::endl;

    return 0;
}
